import React, { Component } from 'react';
import { Button } from 'reactstrap';
import { connect } from 'react-redux';
import { hienThiCacKhuNha } from '../../../actions/khuNhaActions';

class KhuNhaList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: "",
            tenKhuNha: "",
            diaChi: "",
            quanLyKhuNha: "",
            SDT: "",
            openAddModal: false
        }
    }

    componentDidMount = () => {
        this.props.hienThiCacKhuNha();
    }

    render() {
        return (
            <div className="row khu-nha">
                {/* <div className="add">
                    <button>+ Thêm khu nhà</button>
                </div> */}

                <div>
                    <table className="table">
                        <tr>
                            <th>STT</th>
                            <th>Tên khu nhà</th>
                            <th>Địa chỉ</th>
                            <th>Người quản lý</th>
                            <th>Số điện thoại</th>
                            <th>Chỉnh sửa</th>
                            <th>Xóa</th>
                        </tr>
                        <tr>
                            <td>1</td>
                            <td>Khu B10</td>
                            <td>số 10A, Tạ Quang Bửu</td>
                            <td>Nguyễn Thị Mừng</td>
                            <td>0394338777</td>
                            <td>
                                <span>
                                    <i className="far fa-edit"></i>
                                </span>
                            </td>
                            <td>
                                <span>
                                    <i className="fas fa-trash-alt"></i>
                                </span>
                            </td>
                        </tr>

                        {this.props.khuNha.KhuNhas ? this.props.khuNha.KhuNhas.map(
                            item =>
                                <tr>
                                    <td>1</td>
                                    <td>Khu B10</td>
                                    <td>số 10A, Tạ Quang Bửu</td>
                                    <td>Nguyễn Thị Mừng</td>
                                    <td>0394338777</td>
                                    <td>
                                        <span>
                                            <i className="far fa-edit"></i>
                                        </span>
                                    </td>
                                    <td>
                                        <span>
                                            <i className="fas fa-trash-alt"></i>
                                        </span>
                                    </td>
                                </tr>
                        ): null}

                    </table>
                </div>
            </div>
        )
    }
}

const mapStatetoProps = state => {
    return {
        khuNha: state.khuNha
    }
}

const mapActiontoProps = dispatch => {
    return {
        hienThiCacKhuNha: () => dispatch(hienThiCacKhuNha())
    }
}

export default connect(mapStatetoProps, mapActiontoProps)(KhuNhaList);
